Postcard-sized summary of the
morpho language. El lenguaje morpho es simple pero expresivo. Si estás familiarizado con los lenguajes tipo C (C, C++, Java, Javascript) te resultará muy natural. Una descripción mucho más detallada se proporciona en el Capítulo [Idioma](.. /reference/language.md), pero en la figura anterior se proporciona un breve resumen y proporcionamos una descripción general de las ideas clave para ayudarlo a seguir el tutorial: Comentarios. Cualquier texto después de // o rodeado por /``* y *``/ es un comentario y no es procesado por morpho: Este es un comentario
/* ¡Esto también! */ Variables. Para crear una variable, utilice la palabra clave var; A continuación, puede asignar y utilizar la variable arbitrariamente: var a = 1
print a Funciones. Las funciones pueden tomar parámetros, y se les llama así: print sin(x) y decláralos así: fn f(x,y) { return x^2+y^2
} Algunas funciones toman argumentos opcionales, que se ven así: var a = foo(quiet=true) Objetos. Morpho está profundamente orientado a objetos. La mayoría de las cosas en morpho se representan como objetos, que proporcionan métodos que puedes usar para controlarlos. Los objetos están formados por funciones constructoras que comienzan con una letra mayúscula (y pueden tomar argumentos): var a = Object() Las llamadas a métodos tienen el siguiente aspecto: a.foo() Colecciones. Morpho proporciona una serie de tipos de colecciones, todos los cuales son objetos, incluidas listas, var a = [1,2,3] y Diccionarios: var b = { "Massachusetts": "Boston", "California": "Sacramento" } y Rangos (a menudo utilizados en ciclos): var a = 0..10:2 # all even numbers 0-10 inclusive Hay muchas otras, incluyendo Matrices, Matrices dispersas, etc.

