Ahora estamos listos para realizar la optimización, para lo cual necesitamos un objeto Optimizer. Estos vienen en dos sabores: un ShapeOptimizer y un FieldOptimizer que actúan respectivamente sobre la forma y un campo. Los creamos con el problema y la cantidad sobre la que se supone que deben actuar: // Crear optimizadores de formas y campos
var sopt = ShapeOptimizer(problem, m)
var fopt = FieldOptimizer(problem, nn) Una vez creados estos, podemos realizar la optimización llamando al método linesearch con un número específico de iteraciones para cada uno: // Bucle de optimización
for (i in 1..100) { fopt.linesearch(20) sopt.linesearch(20)
} Cada iteración de linesearch hace evolucionar el campo (o forma) hacia abajo en el gradiente del funcional de destino, sujeto a restricciones, y encuentra un tamaño de paso óptimo para reducir el valor del funcional. Aquí, alternamos entre optimizar el campo y optimizar la forma, realizando veinte iteraciones de cada uno, y en general hacemos esto cien veces. Estos números han sido elegidos de forma bastante arbitraria, y si nos fijamos en el resultado nos daremos cuenta de que morpho no siempre ejecuta veinte iteraciones de cada uno. Más bien, en cada iteración comprueba si el cambio en la energía satisface, $$|E|<\epsilon,$$ o, $$\left|\frac{\Delta E}{E}\right|<\epsilon$$ donde el valor de \(\epsilon\), la tolerancia de convergencia se puede cambiar estableciendo la propiedad etol del objeto Optimizer: sopt.etol = 1e-7 // el valor predeterminado es 1E-8 Algunas otras propiedades de un Optimizador que pueden ser útiles para que el usuario las ajuste son las siguientes: Propiedad Valor predeterminado Finalidad etol \(1\times10^{-8}\) Tolerancia en la energía (error relativo) ctol \(1\times10^{-10}\) Tolerancia a restricciones (qué tan bien se satisfacen las restricciones) stepsize 0.1 Tamaño de paso para relax (cambiado por búsqueda de líneas) steplimit 0.5 El tamaño de paso más grande que puede tomar una linesearch maxconstraintsteps `20 Número de pasos que el optimizador puede realizar para garantizar que se satisfagan las restricciones quiet false Si se imprime la salida a medida que se produce la optimización

