Morpho proporciona un sistema de gráficos altamente flexible, con una aplicación de visualización externa morphoview , para permitir visualizaciones enriquecidas de los resultados. Las visualizaciones suelen implicar uno o más objetos Gráphics, que actúan como contenedor para que se muestren los elementos gráficos. Se pueden agregar varios graphics primitives , como esferas, cilindros, flechas, tubos, etc. a un objeto Gráphics para hacer un dibujo. Ahora estamos listos para visualizar los resultados de la optimización. Primero, dibujaremos la malla. Debido a que estamos interesados en ver la estructura de la malla, dibujaremos los bordes (es decir, los elementos de grado 1). La función para hacer esto se proporciona como parte del módulo plot que importamos en la sección Importación de módulos : var g=plotmesh(m, grade=1) A continuación, crearemos un objeto Graphics separado que contenga al director. Dado que el director \(\mathbf{n}\) es un campo vectorial unitario, y el signo no es significativo (la energía elástica nemática es en realidad invariante bajo \(\mathbf{n}\to-\mathbf{n}\)), una forma apropiada de mostrar un solo director es como un cilindro orientado a lo largo de \(\mathbf{n}\). Por lo tanto, crearemos una función auxiliar que cree un objeto 'Graphics' y dibuje un cilindro de este tipo en cada punto de malla: // Función para visualizar un campo de director
// m - la malla // nn - el Campo del director a visualizar
// dl - Escalar el director fn visualize(m, nn, dl) { var v = m.vertexmatrix() var nv = m.count() // Número de vértices var g = Graphics() // Creación de un objeto gráfico for (i in 0...nv) { var x = v.column(i) // Obtener el i-ésimo vértice // Dibuja un cilindro alineado con nn en este vértice g.display(Cylinder(x-nn[i]*dl, x+nn[i]*dl, aspectratio=0.3)) } return g
} Una vez que hemos definido esta función, podemos usarla: var gnn=visualize(m, nn, 0.2) Las variables \(g\) y \(gnn\) ahora se refieren a dos objetos Graphics separados. Podemos combinarlos usando el operador \(+\) y mostrarlos así: var gdisp = g+gnn
Show(gdisp) Optimized mesh and director
field. La visualización resultante se muestra en la Fig. 4.5 .

