Ahora hemos resuelto nuestro primer problema de optimización de formas, y el script completo del problema se proporciona en la carpeta examples/tutorial dentro del repositorio de git como tutorial.morpho. El resultado que hemos obtenido en la Fig. 4.5 es, sin embargo, una solución muy gruesa y de baja resolución que comprende solo un número relativamente pequeño de elementos. Para obtener una solución mejorada, necesitamos refinar nuestra malla. Debido a que la modificación de la malla también requiere que actualicemos otras estructuras de datos como campos y selecciones, se utiliza un objeto especial MeshRefiner para realizar el refinamiento. Para llevar a cabo el refinamiento: Cree un objeto MeshRefiner, proporcionándole una lista de todos los objetos Mesh, Field y Selection (es decir, la malla y los objetos que dependen directamente de él) que deben actualizarse: var mr = MeshRefiner([m, nn, bnd]); // Configurar el refinador Llame al método 'refine' en el objeto MeshRefiner para realizar realmente el refinamiento. Este método devuelve un objeto Dictionary que asigna los objetos antiguos a los potencialmente recién creados. var refmap = mr.refine(); // Realizar el refinamiento Dígale a cualquier otro objeto que haga referencia a la malla, campos o selecciones que actualice sus referencias usando refmap. Por ejemplo, los objetos OptimizationProblem y Optimizer normalmente se actualizan en este paso. for (el in [problem, sopt, fopt]) el.update(refmap); // Actualizar el problema Actualizar nuestras propias referencias m = refmap[m];
nn = refmap[nn];
bnd = refmap[bnd]; // Actualizar variables Optimized mesh and director field at three
successive levels of refinement. Insertamos este código después de nuestra sección de optimización, lo que hace que morpho se optimice y refine sucesivamente. El código completo, incluido el refinamiento, se encuentra en la carpeta examples/tutorial dentro del repositorio git como tutorial2.morpho Las formas optimizadas resultantes se muestran en la Fig. 4.6 . // Bucle de optimización
var refmax = 3
for (refiter in 1..refmax) { print "===Nivel de refinamiento ${refiter}===" for (i en 1..100) { fopt.linesearch(20) sopt.linesearch(20) } if (refiter==refmax) rompe Refinamiento var mr=MeshRefiner([m, nn, bnd]) // Configurar el refinador var refmap=mr.refine() // Realizar el refinamiento for (el in [problem, sopt, fopt]) el.update(refmap) // Actualiza el problema m=refmap[m]; nn=refmap[nn]; bnd=refmap[bnd] // Actualizar variables
}

