Una estrategia potencial para crear mallas para dominios complicados es comenzar creando varias mallas más simples y luego fusionarlas en una malla más grande. La clase MeshMerge en el paquete meshtools nos permite hacer esto. Para usarlo, creamos un objeto MeshMerge con una lista de mallas que deseamos fusionar var mrg = MeshMerge([m1, m2, m3, ... ]) y, a continuación, llame al método merge para realizar la combinación y devolver la malla resultante: var newmesh = mrg.merge() Como ejemplo de esto, construiremos una malla que podría ser una suposición inicial para una membrana sostenida entre dos límites fijos cuadrados. Para ello, crearemos un octante y luego lo reflejaremos a lo largo de diferentes ejes. La unidad básica está construida con PolyhedronMesh, como se muestra en la Fig. 5.11 : var a = 0.5 // Vertical separation
var r = 0.5 // Size of hole
var L = 1 // Size of box // One octant of the mesh var vertices = [ [r,0,a], [L,0,a], [L,r,a], [L,L,a], [r,L,a], [0,L,a], [0,r,a], [r,r,a], [r,0,0], [r,r,0], [0,r,0] ]
var faces = [ [0,1,2,7], [2,3,4,7], [7,4,5,6], [0,8,9,7], [6,7,9,10] ] var m1 = PolyhedronMesh(vertices, faces)
m1.addgrade(1) Ahora necesitamos crear código que refleje una malla sobre uno o más ejes. Hay más de una forma de hacerlo, pero aquí crearemos una clase MeshReflector que siga el patrón del constructor: class MeshReflector { init(mesh) { self.mesh = mesh self.dim = mesh.vertexmatrix().dimensions()[0] // Get Mesh dimension } // Construct a matrix that reflects about one or more axes _reflectionmatrix(axis) { var rmat = Matrix(self.dim,self.dim) for (i in 0...self.dim) rmat[i,i]=1 if (isint(axis)) rmat[axis,axis]*=-1 else if (isobject(axis)) for (i in axis) rmat[i,i]*=-1 return rmat } reflect(axis) { // Reflect the mesh about the given axis or axes var rmat = self._reflectionmatrix(axis) // Clone and transform the mesh var m = self.mesh.clone() for (vid in 0…m.count()) { m.setvertexposition(vid, rmat * m.vertexposition(vid)) } return m }
} Una vez definida esta clase, creamos un MeshReflector y lo usamos para construir siete copias reflejadas: var mr = MeshReflector(m1) // Merge reflected meshed together
var merge = MeshMerge([ m1, mr.reflect(0), mr.reflect(1), mr.reflect(2), mr.reflect([0,1]), mr.reflect([1,2]), mr.reflect([2,0]), mr.reflect([0,1,2]) ])
var m = merge.merge() La malla resultante se muestra en la Fig. 5.11 , panel derecho. Tenga en cuenta que MeshMerge elimina automáticamente los elementos duplicados a medida que se realiza la combinación, de modo que print m1.count(1) informa que había 35 elementos de línea en la malla original, mientras que print m.count(1) produce \(256=8\times(35-6/2)\) elementos de línea, porque hay 6 aristas compartidas para cada copia. By
reflecting a small mesh segment (left) about various axes, we can
assemble a larger mesh (right).

