Equilibrium configuration of nematic
LC in a disk described by the Q tensor formulation. The scalar order
parameter is shown as a density field; the local orientation extracted
from \(Q\) is displayed as
cylinders. Este ejemplo demuestra el uso de la formulación alternativa del tensor Q de la teoría nemática del cristal líquido. Presentamos brevemente la teoría necesaria en dos subsecciones a continuación, luego describimos la implementación en morpho . El tensor Q En 2D, para un nemático uniaxial, podemos definir un tensor Q: $$Q_{ij}=S(n_{i}n_{j}-1/2\delta_{ij})$$ Aquí, el \(-1/2\delta_{ij}\) se agrega por conveniencia, para hacer que la matriz no tenga traza: $$\text{Tr}(\mathbf{Q})=Q_{ii}=S(n_{i}n_{i}-1/2\delta_{ii})=S(1-1/2(2))=0$$ Ahora, el tensor Q también es simétrico por definición: $$Q_{ij}=Q_{ji}$$ Debido a estas dos razones, podemos escribir el tensor Q como una función solo de \(Q_{xx}\) y \(Q_{xy}\): $$ \mathbf{Q}= \begin{bmatrix} Q_{xx} & Q_{xy} \\ Q_{xy} & -Q_{xx} \end{bmatrix}. $$ Energía elástica y anclaje La energía libre de equilibrio de Landau-de Gennes para un cristal líquido nemático se puede escribir en términos del tensor Q: $$ F_{LDG}= \int_{\Omega}d^{2}{\bf x}\ \left(\frac{a_{2}}{2}\text{Tr}(\mathbf{Q}^{2})+\frac{a_{4}}{4}(\text{Tr}\mathbf{Q}^{2})^{2}+\frac{K}{2}(\nabla\mathbf{Q})^{2}\right) $$ $$ +\oint_{\partial\Omega}d{\bf x}\frac{1}{2}E_{A}\text{Tr}[(\mathbf{Q}-\mathbf{W})^{2}] $$ donde \(a_{2}=(\rho-1)\) y \(a_{4}=(\rho+1)/\rho^{2}\) establecen la transición isotrópica a nemática siendo \(\rho\) la densidad no dimensional. El sistema está en el estado isótropo para \(\rho<1\) y en la fase nemática cuando \(\rho>1\). En la fase nemática, \(\ell_{n}=\sqrt{K/a_{2}}\) establece la longitud de la coherencia nemática. Ahora, $$\mathbf{Q}^{2}=\begin{bmatrix}Q_{xx} & Q_{xy} \\ Q_{xy} & -Q_{xx} \end{bmatrix}\begin{bmatrix}Q_{xx} & Q_{xy} \\ Q_{xy} & -Q_{xx} \end{bmatrix}=(Q_{xx}^{2}+Q_{xy}^{2})\begin{bmatrix}1 & 0 \\\ 0 & 1 \end{bmatrix}$$ Por lo tanto, $$\text{Tr}(\mathbf{Q}^{2})=2(Q_{xx}^{2}+Q_{xy}^{2})$$ De manera similar, $$(\nabla\mathbf{Q})^{2}=\partial_{i}Q_{kj}\partial_{i}Q_{kj}=2{(\partial_{x}Q_{xx})^{2}+(\partial_{x} Q_{xy})^{2}+(\partial_{y}Q_{xx})^{2}+(\partial_{y}Q_{xy})^{2}}$$ Ahora, el segundo término es una integral de límite, siendo \(E_{A}\) la fuerza de anclaje. \(\mathbf{W}\) es el tensor correspondiente a la condición de contorno. Por ejemplo, para el anclaje paralelo, $$W_{ij}=(t_{i}t_{j}-1/2\delta_{ij})$$ donde \(t_{i}\) es un componente del vector tangente en el límite. \(\mathbf{W}\) es también un tensor simétrico sin trazas con dos componentes independientes \(W_{xx}\) y \(W_{xy}\). El término límite se convierte en: $$\text{Tr}[(\mathbf{Q}-\mathbf{W})^{2}]=2{Q_{xx}^{2}+Q_{xy}^{2}-2(Q_{xx}W_{xx}+Q_{xy}W_{xy})+W_{xx}^{2}+W_{xy}^{2}}$$ Problema de optimización Podemos formular todas las expresiones anteriores en términos de cantidades vectoriales: $$\vec{q}\equiv \{ Q_{xx},Q_{xy} \} $$ $$\vec{w}\equiv \{w_{xx},w_{xy} \}$$ Así, $$\text{Tr}(\mathbf{Q}^{2})=2||\vec{q}||^{2}$$ $$(\nabla\mathbf{Q})^{2}=2||\nabla\vec{q}||^{2}$$ $$\text{Tr}[(\mathbf{Q}-\mathbf{W})^{2}]=2||\vec{q}-\vec{w}||^{2}$$ Con estos, queremos minimizar la integral de área de $$F=\int_{\Omega}d^{2}{\bf x}\ \left(a_{2}||\vec{q}||^{2}+a_{4}||\vec{q}||^{4}+K||\nabla\vec{q}||^{2}\right)$$ junto con la energía integral de línea $$\oint_{\partial\Omega}d{\bf x}\ E_{A}||\vec{q}-\vec{w}||^{2}$$ Implementación Esta energía libre se establece fácilmente en morpho . Para este ejemplo, consideramos una geometría de disco 2D con radio unitario. Usamos \(\rho=1.3\), de modo que estamos en lo profundo del régimen nemático. Corregimos \(E_{\text{A}}=3\), que establece un fuerte anclaje en el límite. Con este fuerte anclaje tangencial, obtenemos una carga topológica de \(+1\) en el límite, y esto actúa como una restricción. Cuando la longitud de la coherencia nemática es comparable al diámetro del disco (\(\ell_{n}\sim R\)), la carga \(+1\) penetra en todo el disco, mientras que si (\(\ell_{n}\ll R\)), entonces una formación con 2 \(+1/2\) defectos es más estable. Para probar esto, usamos dos valores diferentes de \(K\):, 0.01 y 1.0. Primero definimos todos nuestros parámetros e importamos \(\texttt{disk.mesh}\) desde el ejemplo del tactoide: var rho = 1.3 // Deep in the nematic phase
var EA = 3 // Anchoring strength
var K = 0.01 // Bending modulus var a2 = (1-rho)
var a4 = (1+rho)/rho^2 var m = Mesh(“disk.mesh”)
var m = refinemesh(m) // Refining for a better result
var bnd = Selection(m, boundary=true)
bnd.addgrade(0) // add point elements Definimos el tensor Q en su forma vectorial como se discutió anteriormente, inicializándolo en pequeños valores aleatorios: var q_tensor = Field(m, fn(x,y,z)
Matrix([0.01*random(1), 0.01*random(1)])) Nótese que esto, incidentalmente, hace que el director sea paralelo a una línea de 45 grados. Ahora definimos la energía a granel, la energía de anclaje y la energía libre de distorsión de la siguiente manera: // Define bulk free energy
fn landau(x, q) { var qt = q.norm() var qt2=qt*qt return a2*qt2 + a4*qt2*qt2
}
// Define anchoring energy at the boundary
fn anchoring(x, q) { var t = tangent() var wxx = t[0]*t[0]-0.5 var wxy = t[0]*t[1] return (q[0]-wxx)^2+(q[1]-wxy)^2
} var bulk = AreaIntegral(landau, q_tensor)
var anchor = LineIntegral(anchoring, q_tensor)
var elastic = GradSq(q_tensor) Equipados con las energías, definimos el Problema de Optimización: var problem = OptimizationProblem(m)
problem.addenergy(bulk)
problem.addenergy(elastic, prefactor = K)
problem.addenergy(anchor, selection=bnd, prefactor=EA) Para minimizar la energía con respecto al campo, definimos el FieldOptimizer y realizamos una búsqueda de líneas: var opt = FieldOptimizer(problem, q_tensor)
opt.linesearch(500) Visualización Para visualizar la configuración final, usamos el mismo fragmento de código que usamos para el ejemplo del tactoide, y definimos algunas funciones auxiliares adicionales para extraer el director y el orden del tensor Q: fn qtodirector(q) { var S = 2*q.norm() var Q = q/S var nx = sqrt(Q[0]+0.5) var ny = abs(Q[1]/nx) nx*=sign(Q[1]) return Matrix([nx,ny,0])
} fn qtoorder(q) { var S = 2*q.norm() return S
} Los usamos para crear campos a partir de q_tensor. // Convert the q-tensor to the director and order
var nn = Field(m, Matrix([1,0,0]))
for (i in 0…m.count()) nn[i]=qtodirector(q_tensor[i])
var S = Field(m, 0)
for (i in 0…m.count()) S[i]=qtoorder(q_tensor[i]) y mostrarlos, reutilizando la función visualizar del ejemplo del tutorial de Tactoid. var splot = plotfield(S, style=“interpolate”)
var gnn=visualize(m, nn, 0.05)
var gdisp = splot+gnn
Show(gdisp) Esto crea hermosos gráficos del nemático, que se muestran en la Fig. 7.11 . Al igual que en el ejemplo del tactoide, también podemos hacer un refinamiento adaptativo de la malla basado en la densidad de energía elástica.

