Solution of the Thomson problem for
\(N=100\) charges. Considere \(N\) cargas \(q\) con posiciones \(x_i\) que están confinadas a estar en la esfera unitaria de modo que \(\left| x_i\right|=1 \) que se repelen electrostáticamente y, por lo tanto, cuya configuración minimiza la energía, $$\frac{k}{2}\sum_{i\neq j}\frac{q^{2}}{\left|x_{i}-x_{j}\right|}$$ El problema fue planteado por el físico J. J. Thomson en 1904, en el contexto de un modelo temprano para la estructura de un átomo. Para configurar esto en morpho , comenzamos creando una malla a partir de una secuencia de puntos aleatorios usando un objeto MeshBuilder del módulo meshtools. Tenga en cuenta que esta es una malla bastante inusual; consiste en \(N\) puntos no conectados sin información de conectividad. var build = MeshBuilder()
for (i in 1..Np) { var x = Matrix([2*random()-1, 2*random()-1, 2*random()-1]) x/=x.norm() // Project onto unit sphere build.addvertex(x)
}
var mesh = build.build() A continuación, se especifica el problema de optimización. Usamos el funcional PairwisePotential del módulo functionals y suministramos el potencial de Coulomb \(1/r\), junto con su derivada \(-1/r^{2}\) como funciones anónimas: var problem = OptimizationProblem(mesh)
var lv = PairwisePotential(fn (r) 1/r, fn (r) -1/r^2)
problem.addenergy(lv) La restricción de las partículas a una esfera se implementa como una restricción de conjunto de niveles: Usamos el funcional ScalarPotential como una restricción local para asegurarnos de que cada partícula se encuentra en el contorno cero de la función escalar \(x^{2}+y^{2}+z^{2}-1\), que define la esfera unitaria. var lsph = ScalarPotential(fn (x,y,z) x^2+y^2+z^2-1) problem.addlocalconstraint(lsph) A continuación, se realiza la optimización: var opt = ShapeOptimizer(problem, mesh)
opt.stepsize=0.01/sqrt(Np)
opt.relax(5)
opt.conjugategradient(1000) Observe que estimamos el tamaño del paso inicial a partir del número de partículas. Dado que cada partícula adoptará una fracción \(1/N\) del área, el tamaño del paso es \(\propto1/\sqrt{N}\). En la práctica, encontramos que dar unos pocos pasos de descenso de gradiente con relajación ayuda a acondicionar el problema al separar cualquier partícula de la distribución inicialmente aleatoria que se colocó muy cerca una de la otra. Después de esto, gradiente conjugado funciona bien y, por lo general, converge en alrededor de \(100\) iteraciones. Una última característica interesante de este ejemplo es el uso de una visualización personalizada. Dibujamos una esfera con un centro de masa en la ubicación de cada partícula: var g = Graphics()
for (i in 0...mesh.count()) { g.display(Sphere(mesh.vertexposition(i),1/sqrt(Np)))
} g.display(Sphere([0,0,0],1))
