Continue se usa dentro de bucles para omitir el resto de una iteración. Por ejemplo for (i in 1..5) { // <-. print "Hola" | if (i>3) continue // --' print i
} imprime "Hola" cinco veces, pero solo imprime 1, 2 y 3. Una vez que la condición i>3 es verdadera, la instrucción continue hace que la ejecución se transfiera al inicio del cuerpo del bucle. Los ciclos for tradicionales también admiten continue: // incremento de v
for (var i=0; i<5; i+=1) { if (i==2) continue print i
} Dado que continue hace que el control se transfiera to el incremento section en este tipo de bucle, aquí el programa imprime 0..4 pero se omite el número 2. El uso de bucles 'continue' con 'while' es posible, pero no se recomienda, ya que puede producir fácilmente un bucle infinito! var i=0
while (i<5) { if (i==2) continue print i i+=1
} En este ejemplo, cuando la condición i==2 es true, la ejecución salta al principio, pero i no es incrementada. El ciclo se atasca en la iteración i==2.

