La palabra clave super le permite acceder a los métodos proporcionados por la superclase de un objeto en lugar de la suya propia. Esto es particularmente útil cuando el programador quiere que una clase amplíe la funcionalidad de una clase principal, pero necesita asegurarse de que el comportamiento anterior aún se mantiene. Por ejemplo, considere el siguiente par de clases: class Lunch { init(type) { self.type=type }
} class Soup is Lunch { init(type) { print "¡Deliciosa sopa!" super.init(type) }
} La subclase Soup usa super para llamar al inicializador original.
